  title: 'Button',
  decorators: [withKnobs],
  excludeStories: /.*Data$/,
  includedStories: [],
  component:Button  
};

const label='Type';
const options = {
  long:'long',
  short:'short',
  alert:'alert',
  outlined:'outlined',
  link:'link',
  delete:'delete',
  line:'line',
  icon:'icon'
}
const variant_options = {
  contained: 'contained',
  outlined: 'outlined'
}
