const defaultValue='short';
// const groupId='GROUPT-ID1';
const value=select(label,options,defaultValue);
// const variant_value=radios(variant_label,variant_options);
// button(label,options,defaultValue);

export const Short = () => (<Button  disabled={boolean('disable',false)} type={value}
                                          handleClick={action('Short button clicked')}
                                          handleInputFocus={action('onFocus')}
                                          handleInputBlur={action('onBlur')}
                                          btnText={text("label","Short")}
                                          variant={radios('Variant',variant_options,variant_default)}
                                          disableRipple={boolean("disableRipple", true)} ></Button>
                                          );

export const Long = () => (<Button disabled={boolean("Disabled", false)} variant={radios('Variant',variant_options,variant_default)} fullWidth={boolean("fullWidth", true)} disableRipple={boolean("disableRipple", false)} type={text("Type", 'long')} handleClick={action('onClick')} handleInputFocus={action('onFocus')}  handleInputBlur={action('onBlur')} btnText={text("label",'Long')}/>);



